import React, { useState } from 'react';
import NoteList from './NoteList';  // Import the NoteList component

function App() {
  const [notes, setNotes] = useState([
    { id: 1, title: "First Note", comment: "This is the first note", shareURL: "abc123" },
    { id: 2, title: "Second Note", comment: "This is the second note", shareURL: "def456" }
  ]);

  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">QuickNotes</h1>
      <NoteList notes={notes} />
    </div>
  );
}

export default App;
